import { useState } from 'react';
import axios from 'axios';
import {_apiurluser } from "./APIurlpath/_apiurl";

function Register() {

  const [ output , setOutput ] = useState();
  const [ name , setName ] = useState();     
  const [ email , setEmail ] = useState();
  const [ password , setPassword ] = useState();
  const [ mobile , setMobile ] = useState();
  const [ address , setAddress ] = useState();
  const [ city , setCity ] = useState();
  const [ gender , setGender ] = useState();  




  const handleSubmit=()=>{
    var userDetails={"name":name,"email":email,"password":password,"mobile":mobile,"address":address,"city":city,"gender":gender}

    axios.post(_apiurluser+"save",userDetails).then((response)=>{
      setOutput(response.data.result);
      setName("");
      setEmail("");
      setPassword("");
      setMobile("");
      setAddress("");
      setCity("");
    }).catch((err)=>{
      console.log(err);
    })
}



  return (
<>
    <form action="" class="form_main">
    <p class="heading">Login</p>
    <div class="inputContainer">
