    <path d="M8 1a2 2 0 0 1 2 2v4H6V3a2 2 0 0 1 2-2zm3 6V3a3 3 0 0 0-6 0v4a2 2 0 0 0-2 2v5a2 2 0 0 0 2 2h6a2 2 0 0 0 2-2V9a2 2 0 0 0-2-2z"></path>
    </svg>
    <input type="password"  value={password} class="inputField" onChange={e => setPassword(e.target.value)} class="inputField" id="password" placeholder="Password"/>
</div>


<div class="inputContainer">
    <svg class="inputIcon" xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="#2e2e2e" viewBox="0 0 16 16">
    <path d="M8 1a2 2 0 0 1 2 2v4H6V3a2 2 0 0 1 2-2zm3 6V3a3 3 0 0 0-6 0v4a2 2 0 0 0-2 2v5a2 2 0 0 0 2 2h6a2 2 0 0 0 2-2V9a2 2 0 0 0-2-2z"></path>
    </svg>


    <div >
                          <label for="gender">Gender:</label>
                          Male <input type="radio" value="male" name="gender"
                    onChange={e => setGender(e.target.value)} />
                          &nbsp;&nbsp;
                          Female <input type="radio" value="female" name="gender"
                    onChange={e => setGender(e.target.value)} />
                          &nbsp;&nbsp;
                        </div>


</div>





<button id="button"   onClick={handleSubmit}>Submit</button>

</form>


</>

  );
              }

export default Register;
